import React, { Component } from 'react';

class DisionDialoge extends Component {
    render() {
        return (
            <div class="container">
            <div class="row">
              <div class="col-sm">
                <h3>{this.props.title}</h3>
              </div>
            </div>
          </div>
        );
    }
}

export default DisionDialoge;
